    SPECIES IDENTIFICATION marine mammal observation and visual observation data collected
    in the North Pacific Ocean on the NEW HORIZON cruises NH0005 and NH0007 as part
    of the NEP project from 2000-05-31 to 2000-08-12 (NODC Accession 0113948)",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-26T20:26:42.669398",nt"name": "animals-individual-counts-cetacean-and-species-identification-marine-mammal-observation-and-v",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113948 includes marine
    mammal observation, visual observation and biological data collected aboard the
    NEW HORIZON during cruises NH0005 and NH0007 in the North Pacific Ocean from 2000-05-31
    to 2000-08-12. These data include ANIMALS - INDIVIDUAL - COUNTS, cetacean and SPECIES
    IDENTIFICATION. The instruments used to collect these data include binocular. These
    data were collected by Cynthia Tynan of Northwest Fisheries Science Center - Seattle
    and David G. Ainley of H.T. Harvey & Associates as part of NEP. The Biological and
    Chemical Oceanography Data Management Office (BCO-DMO) submitted these data to NODC
    on 2013-09-28.nnThe following is the text of the abstract provided by BCO-DMO:nnGLOBEC
    NEP Northern California Current Cetacean Survey DatanR/V New Horizon cruises NH0005
    and 0007nnLine-transect surveys of cetaceans were conducted during two cruises of
    the GLOBEC Northeast Pacific Northern California Current (NCC) program in 2000:
    May 29 -June 13 and July 27 - August 12. Surveys were conducted across the shelf
    and slope off Oregon and northern California (41.9&deg; - 44.65&deg; N) from the
    coast to ~125.5&deg;W.nFor additional information please see the following publication:nCynthia
    T. Tynan, David G. Ainley, John A. Barth, Timothy J. Cowles, Stephen D. Pierce and
    Larry B. Spear, 2005. Cetacean distributions relative to ocean processes in the
    northern California Current System Deep Sea Research Part II: Topical Studies in
    Oceanography, Volume 52, Issues 1-2, January 2005, Pages 145-167nAny questions,
    contact PIs:nCynthia T. TynannDavid G. Ainley (H.T. Harvey & Associates)nupdated
